import React from 'react';

export default function Log({ isLoggedIn, onLogin }) {
  // If user is already logged in, render the home page
  if (isLoggedIn) {
    return <Home />;
  }

  // If user is not logged in, render the login page
  return (
    <div>
      <h1>Login Page</h1>
      <button onClick={onLogin}>Log In</button>
    </div>
  );
}

function Home() {
  return <h1>Home Page</h1>;
}
